import React,{useState, useEffect} from 'react';
import axios from 'axios';
import {FormControl} from 'react-bootstrap';
export default function PencarianBarang() {
	
	return(

		<>
		<h1>Testing Pencarian</h1>
		<FormControl
          type="search"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
        />
		</>

		)
}
